import BookShow from "./BookShow";

function BookList({ bookList, onDelete, onEdit }) {
  const renderedList = bookList.map((book) => {
    return (
      <BookShow 
      book={book} 
      key={book.id} 
      onDelete={onDelete} o
      nEdit={onEdit} />
    );
  });

  return <div>{renderedList}</div>;
}

export default BookList;
